import React, { useState } from 'react';
import './Home.css';

const Home = () => {
  const [searchParams, setSearchParams] = useState({
    location: '',
    type: '',
    priceRange: [0, 1000],
    amenities: [],
  });

  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleSearch = (e) => {
    e.preventDefault();
    // Implement search functionality here
    console.log('Search params:', searchParams);
  };

  const handleAddProperty = () => {
    // Implement add property functionality here
    console.log('Add property clicked');
  };

  const handleBookNow = (listingId) => {
    // Implement booking functionality here
    console.log('Book now clicked for listing:', listingId);
  };

  const handleChatWithLandlord = (landlordId) => {
    // Implement chat functionality here
    console.log('Chat with landlord clicked for landlord:', landlordId);
  };

  return (
    <div className="home">
      {/* Navbar */}
      <nav className="navbar">
        <div className="navbar-logo">RoomRental</div>
        <ul className="navbar-links">
          <li><a href="#home">Home</a></li>
          <li><a href="#services">Services</a></li>
          <li><a href="#find-room">Find a Room</a></li>
          <li><button onClick={handleAddProperty}>Add Property</button></li>
          <li>
            {isLoggedIn ? (
              <button onClick={() => setIsLoggedIn(false)}>Logout</button>
            ) : (
              <button onClick={() => setIsLoggedIn(true)}>Login/Register</button>
            )}
          </li>
        </ul>
        <div className="navbar-icons">
          <span className="icon notifications">🔔</span>
          <span className="icon messages">✉️</span>
        </div>
      </nav>

      {/* Hero Section with Search Bar */}
      <section className="hero">
        <h1>Find Your Perfect Room</h1>
        <form className="search-bar" onSubmit={handleSearch}>
          <select
            value={searchParams.location}
            onChange={(e) => setSearchParams({ ...searchParams, location: e.target.value })}
          >
            <option value="">Select Location</option>
            <option value="new-york">New York</option>
            <option value="los-angeles">Los Angeles</option>
            <option value="chicago">Chicago</option>
          </select>
          <select
            value={searchParams.type}
            onChange={(e) => setSearchParams({ ...searchParams, type: e.target.value })}
          >
            <option value="">Select Type</option>
            <option value="furnished">Furnished</option>
            <option value="non-furnished">Non-Furnished</option>
          </select>
          <div className="price-range">
            <input
              type="range"
              min="0"
              max="1000"
              value={searchParams.priceRange[1]}
              onChange={(e) => setSearchParams({ ...searchParams, priceRange: [0, parseInt(e.target.value)] })}
            />
            <span>$0 - ${searchParams.priceRange[1]}</span>
          </div>
          <div className="amenities">
            <label>
              <input
                type="checkbox"
                checked={searchParams.amenities.includes('wifi')}
                onChange={(e) => {
                  const newAmenities = e.target.checked
                    ? [...searchParams.amenities, 'wifi']
                    : searchParams.amenities.filter(a => a !== 'wifi');
                  setSearchParams({ ...searchParams, amenities: newAmenities });
                }}
              />
              Wi-Fi
            </label>
            <label>
              <input
                type="checkbox"
                checked={searchParams.amenities.includes('parking')}
                onChange={(e) => {
                  const newAmenities = e.target.checked
                    ? [...searchParams.amenities, 'parking']
                    : searchParams.amenities.filter(a => a !== 'parking');
                  setSearchParams({ ...searchParams, amenities: newAmenities });
                }}
              />
              Parking
            </label>
          </div>
          <button type="submit">Search</button>
        </form>
      </section>

      {/* Featured Listings */}
      <section className="featured-listings">
        <h2>Featured Listings</h2>
        <div className="listings-grid">
          {[1, 2, 3].map((listing) => (
            <div key={listing} className="listing-card">
              <img src={`https://via.placeholder.com/300x200?text=Room+${listing}`} alt={`Room ${listing}`} />
              <h3>Cozy Room in Downtown</h3>
              <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
              <p className="price">$500/month</p>
              <div className="listing-actions">
                <button onClick={() => handleBookNow(listing)}>Book Now</button>
                <button onClick={() => handleChatWithLandlord(listing)}>Chat with Landlord</button>
              </div>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <div className="footer-links">
          <a href="#about">About Us</a>
          <a href="#privacy">Privacy Policy</a>
          <a href="#terms">Terms & Conditions</a>
        </div>
        <div className="social-icons">
          <span className="icon">📘</span>
          <span className="icon">🐦</span>
          <span className="icon">📸</span>
        </div>
      </footer>
    </div>
  );
};

export default Home;
